INSERT INTO `letters` (`letter_id`, `address`, `subject`, `created_by`, `message`, `date_created`, `delete_flag`) VALUES
(3, 't\\jnnbg\nmmmb\n', 'opening of account', '158  ', 'jnmsn\\\nmbb ss\n', '2018-09-02 21:00:00', 0),
(4, 'FAITH AGENCIES AUCTIONEERS \nP.O. BOX 2112 90100\nMACHAKOS.\n\nATT:  MR. B. M. MUTUNE  \n', 'AUTHORITY TO FOLLOW UP OUR DEFAULT CLIENTS ', '68         ', 'The matter above refers; \n\nWe  write to authorize you to follow up payments for the following defaulters :-\n     1. Mr.  David Katue\n     2. Mrs. Doreen Mwende Nzomo\n     3. Mrs. Janet  Katunge Nzyuko\n     4. Mr.   Peter Kilungu \n     5. Mrs.  Everlyine Nthenya Musau\n\n\nWe attach herein more details pertaining these clients for your assessment and execution. \n\nplease revert to us in case more information is required. \n\nFor and on behalf of Rekimu Credit Ltd.\n\n\n\nPeter Kitaka      ( Director)                                                                                                            \n\n\n\nJeremiah Masango    ( Director)\n\n ', '2019-02-21 21:00:00', 0),
(2, 'The Branch Manager \nNIC Bank - Machakos ', 'RE: OPENING OF BANK ACCOUNT WITH NIC BANK - MACHAKOS', '68   ', 'The above matter refers; \n\nBeing the directors of Rekimu Credit Ltd, we have resolved to open and operate a bank account with NIC Bank Machakos. \nThe signing mandate for the account will be both must sign for any withdrawals.  It is our hope that we will find your bank accommodating and affordable in this new business relationship. \n\nYours faithful\n\n\n\nPeter N. Kitaka ( Director)                ________________________________\n                                \n\nJeremiah M. Masango ( Director)    ________________________________', '2018-08-27 21:00:00', 0),
(5, 'THE REGISTRAR \nMEDIATION ACCREDITATION COMMITTEE \nSUPREME COURT BUILDING ROOM 35\nP. O. BOX 30041  - 00100\nNAIROBI ', 'LETTER OF RECOMMENDATION FOR MR. PETER KITAKA   ', '68     ', 'The matter above refers; \nMr. Peter Kitaka is an employee with Rekimu Credit Ltd as a Director in charge of Operations. He has been with Rekimu Credit since 2017 and has been very instrumental in formulating the institution\'s lending policies. He has trained as a professional mediator with Mediation Training Institute East Africa a move that as a company we have supported. The skills learned will go a long way to assist Rekimu Credit and the the society in general.  \n \nRekimu Credit Ltd recommends Mr. Peter Kitaka  to Mediation Accreditation committee to be accredited as a professional mediator. We are convinced that he has the necessary etiquette and charisma to successfully perform this task as per the set standards. \n\n\nYours faithfully\n\n\n\nJeremiah Masango - Director\nRekimu Credit Ltd  ', '2018-09-16 21:00:00', 0),
(6, 'Caroline Zachaeus\n\nC/O Ourselves \n', 'REF: EMPLOYMENT CONTRACT AS A CREDIT OFFICER  ', '68     ', 'Rekimu Credit Limited is pleased to inform you that you have been engaged on contract basis for a period of Twelve (12) months effective 1st October, 2018 to 30th September 2019. \n\nIn accordance with your contract of employment, you will be entitled for a monthly allowance of Kes. 10,000/- ( Kenya Shillings Ten Thousand Only) payable in arrears at the end for each month. \n\nThe Board of Directors - Rekimu Credit Limited recognizes the  vital role you have been entrusted to play and would like to reiterate that they will give you full support that you would want to discharge your duties expeditiously.\n\nYour job description  includes among others:\n                             i.  apartment Management : Client\'s apartment appraisal, disbursement and monitoring. \n                            ii.  Documents Management : keeping proper client files both in hard and soft system.\n                           iii.  Prepare and file monthly reports ; profit and loss per month, expenditure reports  \n                           iv.  General office operations and any other duty as assigned by the directors. \n                           \nMonth to month Targets: \n                             i. Maintain the delayed apartments to less than 20 every month.\n                            ii. Ensure all bad apartments over 90 days are forwarded to the auctioneers and proper follow up\n                               report compiled going forward. \n                           iii. Introduce five new good clients every month. \n                           iv. Ensure office operation expenses are minimized and no income leakage. \n\nYou will be expected to to exercise a high degree of confidentiality in all your transactions.\n                           \n\nWe wish you all the best as you put your best foot forward to achieve and exceed the expectations.  \n\n\nYours Faithfully \n\n\n\nPeter Kitaka; \nDirector Operations \n\n', '2018-09-25 21:00:00', 0),
(7, 'Caroline Zachaeus\n\nC/O Ourselves \n', 'REF: EMPLOYMENT CONTRACT : CAROLINE ZACHAEUS ', '68 ', 'Rekimu Credit Limited is pleased to inform you that you have been engaged on contract basis for a period of Twelve (12) months effective 1st October, 2018 to 30th September 2019. \n\nIn accordance with your contract of employment, you will be entitled for a monthly allowance of Kes. 10,000/- ( Kenya Shillings Ten Thousand Only) payable in arrears at the end for each month. \n\nThe Board of Directors - Rekimu Credit Limited recognizes the  vital role you have been entrusted to play and would like to reiterate that they will give you full support you would want to discharge your duties expeditiously.\n\nYour job description  includes among others:\n                             i.  apartment Management : Client\'s apartment appraisal, disbursement and monitoring. \n                            ii.  Documents Management : keeping proper client files both in hard and soft system. \n                           iii.  General office operations and any other duty as advised by the directors. \nMonth to month Targets: \n                             i. Maintain the delayed apartments to less than 20 every month.\n                            ii. Ensure all bad apartments over 90 days are forwarded to the auctioneers and proper follow up\n                               report compiled going forward. \n                           iii. \nWe wish you all the best as you put your best put forward to achieve and exceed the expectations.  ', '2018-09-25 21:00:00', 0);
